var encoder = new import_ethers3.ethers.utils.AbiCoder();
var command = process.argv[2];
var fixtureData = JSON.parse(import_fs.default.readFileSync("./test/beefy/data/beefy-commitment.json", "utf8"));
var validatorSetID = fixtureData.params.id;
var validatorSetSize = process.env["FixedSet"] == "true" ? accounts.length : 300;
var commitHash = fixtureData.commitmentHash;
var blockNumber = fixtureData.params.commitment.blockNumber;
var mmrLeafProofs = fixtureData.params.leafProof;
var payload = fixtureData.params.commitment.payload;
var mmrLeaf = fixtureData.params.leaf;
var leafProofOrder = fixtureData.params.leafProofOrder;
var subsetSize = validatorSetSize - Math.floor((validatorSetSize - 1) / 3);
var subset = createRandomSubset(validatorSetSize, subsetSize);
var validatorSet;
if (command == "GenerateInitialSet") {
  process.stdout.write(
    `${encoder.encode(
      [
        "uint32",
        "uint32",
        "uint32",
        "uint256[]",
        "bytes32",
        "tuple(bytes32 mmrRootHash,bytes prefix,bytes suffix)"
      ],
      [blockNumber, validatorSetID, validatorSetSize, subset, commitHash, payload]
    )}`
  );
} else if (command == "GenerateProofs") {
  if (process.env["FixedSet"] == "true") {
    validatorSet = new ValidatorSet(
      validatorSetID,
      validatorSetSize,
      accounts.map((account) => account.privateKey)
    );
  } else {
    validatorSet = new ValidatorSet(validatorSetID, validatorSetSize);
  }
  const validatorProof = validatorSet.createSignatureProof(subset[0], commitHash);
  const finalBitfieldLength = parseInt(process.argv[3]);
  let finalBitfield = [];
  for (let i = 0; i < finalBitfieldLength; i++) {
    finalBitfield.push(import_ethers3.ethers.BigNumber.from(process.argv[4 + i]));
  }
  const validatorFinalProofs = readSetBits(finalBitfield).map(
    (i) => validatorSet.createSignatureProof(i, commitHash)
  );
  process.stdout.write(
    `${encoder.encode(
      [
        "bytes32",
        "tuple(uint8 v, bytes32 r, bytes32 s, uint256 index,address account,bytes32[] proof)",
        "tuple(uint8 v, bytes32 r, bytes32 s, uint256 index,address account,bytes32[] proof)[]",
        "bytes32[]",
        "tuple(uint8 version,uint32 parentNumber,bytes32 parentHash,uint64 nextAuthoritySetID,uint32 nextAuthoritySetLen,bytes32 nextAuthoritySetRoot,bytes32 parachainHeadsRoot)",
        "uint256"
      ],
      [
        validatorSet.root,
        validatorProof,
        validatorFinalProofs,
        mmrLeafProofs,
        mmrLeaf,
        leafProofOrder
      ]
    )}`
  );
}
